import './App.css';
import { useState } from 'react';
function App() {
  const [count, SetCount] = useState(0);
  return (
    <div className="App">
      <p className='text'>{count}</p>
      <button onClick={() => SetCount(count + 1)} className='button'>Add </button>
      <button onClick={()=> SetCount(count - 1)} className='button'> Sub </button>

    </div>
  );
}
